import React, { Component } from 'react';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import "fullpage.js/vendors/scrolloverflow"; // Optional. When using scrollOverflow:true
import ReactFullpage from "@fullpage/react-fullpage";

class Resume extends Component {
  render() {
    return (
      <ReactFullpage
        fitToSection = {true}
        sectionsColor = {["orange", "white", "green"]}
        scrollOverflow = {true}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section">
                <div>
                <Link to="/PC-folio.github.io/">
                  Projects</Link>
                <Link to="/PC-folio.github.io/projects">
                  Resume</Link>
                </div>
              </div>
              <div className="section">
                  <div className="slide">
                    <h3>Slide 2.1</h3>
                    <button onClick={() => fullpageApi.moveTo(3, 0)}>
                      Move top
                    </button>
                  </div>
                  <div className="slide">
                    <h3>Slide 2.2</h3>
                  </div>
                  <div className="slide">
                    <h3>Slide 2.3</h3>
                  </div>
                </div>
              <div className="section">
                <h3>Section 3</h3>
                <button onClick={() => fullpageApi.moveTo(2, 0)}>
                  Move top
                </button>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default Resume;
